BlocklyGamesMsg["Pond.helpUseScan"] = "Твоё решение работает, но можно сделать лучше. Используй 'scan', чтобы указать расстояние для стрельбы пушки.";
BlocklyGamesMsg["Pond.helpText1"] = "Используйте команду 'cannon', чтобы поразить цель. Первый параметр — угол, второй — расстояние. Найдите правильное сочетание.";
BlocklyGamesMsg["Pond.helpText2"] = "Эта цель должна быть поражена много раз. Используй цикл 'while (true)', чтобы делать что-то бесконечно.";
BlocklyGamesMsg["Pond.helpText3a"] = "Этот противник двигается взад-вперёд, из-за чего в него трудно попасть. Выражение 'scan' возвращает точное расстояние до противника в указанном направлении.";
BlocklyGamesMsg["Pond.helpText3b"] = "Расстояние — именно то, что нужно команде 'cannon' для точной стрельбы.";
BlocklyGamesMsg["Pond.helpText4"] = "Этот противник слишком далеко, чтобы использовать пушку (которая имеет ограничение 70 метров). Вместо этого, используй команду 'swim', чтобы плыть в сторону противника и врезаться в него.";
BlocklyGamesMsg["Pond.helpText5"] = "Этот противник тоже слишком далеко, чтобы использовать пушки. Но ты слишком слаб, чтобы выжить в столкновении. Плыви в сторону противника, пока твоё горизонтальное положение меньше 50. Затем 'stop' и используй пушки.";
BlocklyGamesMsg["Pond.helpText6"] = "Этот противник будет отходить, когда в него попали. Плыви вперед, если он находится вне диапазона (70 метров).";
